import React from "react";
import Footer from "../Footer";
import "./Contact.css";

function About() {
  return (
    <div class="container">
      <div contact="contactinfo">
        <div>
          <h2>Contact Us</h2>
          <ul class="info">
            <li>
              <span>
                <img src="location.png" />
              </span>
              <span>
                2170 The Alameda, Ste 200
                <br />
                San Jose, CA 95126
              </span>
            </li>
          </ul>
        </div>
      </div>
    </div>

  );
}
export default Contact;
